import React, { Component } from 'react'

const data = [
    { id: '01', content: '你妈' },
    { id: '02', content: '你爹' },
    { id: '03', content: 'dou' },
]

export default class Detail extends Component {
  render() {
    return (
      <ul>
        <li>ID:</li>
        <li>TITLE:</li>
        <li>CONTENT:</li>
      </ul>
    )
  }
}
